    final int id;
    final String companyName;
    final String symbol;
    final String logo;

    TickerSymbol(int id, String companyName, String symbol, String logo) {
        this.id = id;
        this.companyName = companyName;
        this.symbol = symbol;
        this.logo = logo;
    }

    public static String getLogoBySymbol(String symbol) {
        Optional<TickerSymbol> logo = Arrays.stream(TickerSymbol.values())
                .filter(value -> value.getSymbol().equalsIgnoreCase(symbol))
                .findFirst();

        return logo.isPresent() ? logo.get().getLogo() : "https://s3-symbol-logo.tradingview.com/i--big.svg";
    }

